func (res *RawEventSelect) sqlScan(ctx context.Context, v interface{}) error {
	rows := &sql.Rows{}
	query, args := res.sqlQuery().Query()
	if err := res.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (res *RawEventSelect) sqlQuery() sql.Querier {
	selector := res.sql
	selector.Select(selector.Columns(res.fields...)...)
	return selector
}
